import { ScrollingCarousel } from "@trendyol-js/react-carousel";
import { Component } from "react";
import BookCard from "./booksDir/BookCard.js";

export default class Books extends Component {
  render() {
    const settings = {
      className: "center",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500
    };
    return (
    <div>
        <ScrollingCarousel>
          <Slide>
          <BookCard/>
        </Slide>
        </ScrollingCarousel>
    </div>
    );
  }
}
